import { Injectable } from '@angular/core';
import { Observable, of } from 'rxjs';
import {  Experience,  } from '../models/experience';
import { Project } from '../models/project';
import {  Skill } from '../models/skill';

@Injectable({
  providedIn: 'root'
})
export class PortfolioService {

  private projects: Project[] = [
    {
      id: 1,
      title: 'E-Commerce MEAN Stack Application',
      description: 'Full-stack e-commerce platform with user authentication, product management, shopping cart, and payment integration.',
      technologies: ['Angular', 'Node.js', 'Express.js', 'MongoDB', 'JWT', 'Stripe API'],
      image: 'assets/images/ecommerce-project.jpg',
      demoUrl: 'https://demo-ecommerce.com',
      githubUrl: 'https://github.com/username/ecommerce-app',
      features: [
        'User Authentication & Authorization',
        'Product Catalog with Search & Filters',
        'Shopping Cart & Checkout Process',
        'Payment Integration with Stripe',
        'Admin Panel for Product Management',
        'Order History & Tracking'
      ],
      category: 'fullstack'
    },
    {
      id: 2,
      title: 'Real-Time Chat Application',
      description: 'Real-time messaging application with Socket.io, featuring private chats, group conversations, and file sharing.',
      technologies: ['Angular', 'Node.js', 'Socket.io', 'MongoDB', 'Express.js'],
      image: 'assets/images/chat-app.jpg',
      demoUrl: 'https://demo-chat.com',
      githubUrl: 'https://github.com/username/chat-app',
      features: [
        'Real-time messaging with Socket.io',
        'Private and group conversations',
        'File and image sharing',
        'Online status indicators',
        'Message history persistence',
        'Responsive design'
      ],
      category: 'fullstack'
    },
    {
      id: 3,
      title: 'Task Management Dashboard',
      description: 'Project management tool with Kanban boards, team collaboration, and progress tracking.',
      technologies: ['Angular', 'Node.js', 'Express.js', 'PostgreSQL', 'JWT'],
      image: 'assets/images/task-management.jpg',
      demoUrl: 'https://demo-taskmanager.com',
      githubUrl: 'https://github.com/username/task-manager',
      features: [
        'Kanban board interface',
        'Team collaboration tools',
        'Progress tracking & analytics',
        'Role-based access control',
        'File attachments',
        'Email notifications'
      ],
      category: 'fullstack'
    }
  ];

  private experiences: Experience[] = [
    {
      id: 1,
      company: 'Tech Solutions Inc.',
      position: 'MEAN Stack Developer',
      duration: 'Jan 2023 - Present',
      location: 'Remote',
      description: [
        'Led development of 3 major web applications serving 10,000+ users',
        'Implemented microservices architecture reducing server response time by 40%',
        'Mentored 2 junior developers and conducted code reviews',
        'Collaborated with UX/UI designers to implement responsive designs',
        'Optimized database queries resulting in 30% performance improvement'
      ],
      technologies: ['Angular', 'Node.js', 'Express.js', 'MongoDB', 'AWS', 'Docker']
    },
    {
      id: 2,
      company: 'Digital Innovations LLC',
      position: 'Full Stack Developer',
      duration: 'Jun 2022 - Dec 2022',
      location: 'New York, NY',
      description: [
        'Developed and maintained 5+ web applications using MEAN stack',
        'Integrated third-party APIs including payment gateways and social media',
        'Implemented automated testing reducing bug reports by 25%',
        'Participated in agile development processes and sprint planning',
        'Created comprehensive technical documentation'
      ],
      technologies: ['Angular', 'Node.js', 'Express.js', 'MongoDB', 'Jest', 'Git']
    },
    {
      id: 3,
      company: 'StartupTech',
      position: 'Junior Full Stack Developer',
      duration: 'May 2021 - May 2022',
      location: 'San Francisco, CA',
      description: [
        'Built responsive web applications from scratch using MEAN stack',
        'Collaborated with design team to implement pixel-perfect UI components',
        'Participated in daily standups and sprint retrospectives',
        'Learned and applied best practices in code organization and documentation',
        'Contributed to open-source projects and internal tools'
      ],
      technologies: ['Angular', 'Node.js', 'Express.js', 'MongoDB', 'Bootstrap']
    }
  ];

  private skills: Skill[] = [
    // Frontend
    { name: 'Angular', level: 90, category: 'frontend', icon: 'bi-angular', image:"../../../assets/htmlIcon.webp" },
    { name: 'TypeScript', level: 85, category: 'frontend', icon: 'bi-code-slash',image:"../../../assets/htmlIcon.webp" },
    { name: 'JavaScript', level: 90, category: 'frontend', icon: 'bi-javascript' ,image:"../../../assets/jsIcon.webp"},
    { name: 'HTML5', level: 95, category: 'frontend', icon: 'bi-html5' ,image:"../../../assets/htmlIcon.webp"},
    { name: 'CSS3/SCSS', level: 90, category: 'frontend', icon: 'bi-css3' ,image:"../../../assets/cssIcon.webp"},
    { name: 'Bootstrap', level: 85, category: 'frontend', icon: 'bi-bootstrap' ,image:"../../../assets/htmlIcon.webp"},
    { name: 'RxJS', level: 80, category: 'frontend', icon: 'bi-arrow-repeat' ,image:"../../../assests.htmlIcon.webp"},

    // Backend
    { name: 'Node.js', level: 85, category: 'backend', icon: 'bi-server', image:"../../assests.htmlIcon.webp" },
    { name: 'Express.js', level: 85, category: 'backend', icon: 'bi-gear' ,image:"../../assests.htmlIcon.webp"},
    { name: 'RESTful APIs', level: 90, category: 'backend', icon: 'bi-api' ,image:"../../assests.htmlIcon.webp"},
    { name: 'JWT Authentication', level: 80, category: 'backend', icon: 'bi-shield-check' ,image:"../../assests.htmlIcon.webp"},
    { name: 'Socket.io', level: 75, category: 'backend', icon: 'bi-chat-dots' ,image:"../../assests.htmlIcon.webp"},

    // Database
    { name: 'MongoDB', level: 85, category: 'database', icon: 'bi-database',image:"../../assests.htmlIcon.webp" },
    { name: 'Mongoose', level: 80, category: 'database', icon: 'bi-diagram-3' ,image:"../../assests.htmlIcon.webp"},
    { name: 'PostgreSQL', level: 70, category: 'database', icon: 'bi-table',image:"../../assests.htmlIcon.webp" },

    // Tools
    { name: 'Git/GitHub', level: 90, category: 'tools', icon: 'bi-git' ,image:"../../assests.htmlIcon.webp"},
    { name: 'Docker', level: 70, category: 'tools', icon: 'bi-box' ,image:"../../assests.htmlIcon.webp"},
    { name: 'AWS', level: 65, category: 'tools', icon: 'bi-cloud',image:"../../assests.htmlIcon.webp" },
    { name: 'Jest/Jasmine', level: 75, category: 'tools', icon: 'bi-check-circle',image:"../../assests.htmlIcon.webp" },
    { name: 'Postman', level: 85, category: 'tools', icon: 'bi-send',image:"../../assests.htmlIcon.webp" }
  ];

  getProjects(): Observable<Project[]> {
    return of(this.projects);
  }

  getExperiences(): Observable<Experience[]> {
    return of(this.experiences);
  }

  getSkills(): Observable<Skill[]> {
    return of(this.skills);
  }

  getSkillsByCategory(category: string): Observable<Skill[]> {
    return of(this.skills.filter(skill => skill.category === category));
  }
}
